import TitleLabel from '../atoms/TitleLabel';
import ContentLabel from '../atoms/ContentLabel';

function Card() {
  return (
    <div className="card">
      <div className="card-content">
        <TitleLabel title="タイトルです" />
        <ContentLabel content="内容です" />
      </div>
    </div>
  );
}

export default Card;
